script: |
  super -f text -I q5265.spq | sort > q5265.out

inputs:
  - name: q5265.spq
    data: |
      SELECT DISTINCT - 3 - + + col1 - - ( + 16 ) - - - col0 * 8 AS col1, + col0 + - 58 - + ( - col0 ) / col0 AS col2 FROM tab2 (FORMAT parquet);
  - name: tab2

outputs:
  - name: q5265.out
    data: |
      -406	-11
      -576	7
      -654	18
